import React, { useState, useEffect } from "react";
import styled, { css } from "styled-components";

export default function NotFound({ match, history }) {
  // JSON 파일을 만들어서 ContentsId랑 일치하는 오브젝트 불러오기
  return (
    <div>
      <h1>404 not found!</h1>
    </div>
  );
}
